import{_ as e,o as r,c as a,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 32.1-111.14:7 Penalty for disobeying emergency medical services agency chief or other officer in command.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-111.14:7.md","filePath":"vacode/32.1-111.14:7.md"}'),o={name:"vacode/32.1-111.14:7.md"},n=i('<h1 id="§-32-1-111-14-7-penalty-for-disobeying-emergency-medical-services-agency-chief-or-other-officer-in-command" tabindex="-1">§ 32.1-111.14:7 Penalty for disobeying emergency medical services agency chief or other officer in command. <a class="header-anchor" href="#§-32-1-111-14-7-penalty-for-disobeying-emergency-medical-services-agency-chief-or-other-officer-in-command" aria-label="Permalink to &quot;§ 32.1-111.14:7 Penalty for disobeying emergency medical services agency chief or other officer in command.&quot;">​</a></h1><p>If any person at a fire or medical emergency refuses or neglects to obey any order duly given by the individual having command of the incident in accordance with § <a href="http://law.lis.virginia.gov/vacode/32.1-111.14:5/" target="_blank" rel="noreferrer">32.1-111.14:5</a> or <a href="http://law.lis.virginia.gov/vacode/32.1-111.14:6/" target="_blank" rel="noreferrer">32.1-111.14:6</a>, he shall, upon conviction of such offense, be fined not to exceed $100.</p><p>2015, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0502" target="_blank" rel="noreferrer">502</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0503" target="_blank" rel="noreferrer">503</a>.</p>',3),c=[n];function t(s,f,l,d,g,h){return r(),a("div",null,c)}const y=e(o,[["render",t]]);export{m as __pageData,y as default};
